import '../Assets/Styles/MoreInfoComponentStyles.css'

function MoreInfoComponent(){
    return(
        <main className="more-container">
            <h1>More info</h1>
            <section>
                <h3>Why i become software developer?</h3>
            </section>
        </main>
    );
}

export default MoreInfoComponent;
